import React from 'react';
import { Footer } from '../../../component/Public/Footer.js';
import styles from '../../../css/Work.module.css';
import Secure from '../../../component/Work/Secure.js';
import { Drawer } from '../../../component/Public/Drawer.js';
import { Scrollup } from '../../../component/Public/Scrollup.js'; 
import Grid from '@material-ui/core/Grid';

const Page = () => {

    const [drawer, setDrawer] = React.useState(false);

    const handleDrawerOpen = () => {
        setDrawer(true);
    }

    const handleDrawerClose = () => {
        setDrawer(false);
    }

    return(
        <React.Fragment>

            {drawer == false ?
                <React.Fragment>
                    <div>
                        <Secure
                            handleDrawerOpen={handleDrawerOpen}
                        />
                    </div>

                    <Grid container style={{top:'70%',position:'fixed'}}>
                        <Grid item xs={5} md={8}></Grid>
                        <Grid item xs={4} md={3}>
                            <Scrollup/>
                        </Grid>
                    </Grid>

                    <div className={styles.footer}>
                        <Footer/>
                    </div>
                </React.Fragment>
            :''}

            {drawer == true ?
                <React.Fragment>
                    <div style={{backgroundColor:'#1f1f1f'}}>
                        <Drawer
                            handleDrawerClose={handleDrawerClose} 
                        />
                    </div>
                </React.Fragment>
            :''}

        </React.Fragment>
    )
}

export default Page;
